Translation of the question: Gretchen has 110 coins. There are 30 more gold coins than silver coins. How many gold coins does Gretchen have?

Let's denote the number of gold coins as $x$ and the number of silver coins as $y$. According to the problem, we have the following system of equations:
\begin{align*}
x + y &= 110 \\
x &= y + 30
\end{align*}

Substituting the second equation into the first, we get:
\begin{align*}
(y + 30) + y &= 110 \\
2y + 30 &= 110 \\
2y &= 80 \\
y &= 40
\end{align*}

Now, substituting $y = 40$ back into the second equation to find $x$:
\begin{align*}
x &= y + 30 \\
x &= 40 + 30 \\
x &= 70
\end{align*}

Therefore, Gretchen has $\\boxed{70}$ gold coins.
